# Define popular restaurants for the homepage
POPULAR_RESTAURANT_IDS = ["1", "3", "2"]

@app.route('/')
def home():
    """Render the homepage with popular restaurants."""
    # Debug print to verify the data
    print("Popular IDs:", POPULAR_RESTAURANT_IDS)
    print("First restaurant:", restaurants["1"]["title"])
    return render_template('home.html', popular_shop_ids=POPULAR_RESTAURANT_IDS, coffee_shops=restaurants)

@app.route('/view/<shop_id>')
def view_shop(shop_id):
    """View details of a specific restaurant."""
    if shop_id in restaurants:
        return render_template('view.html', shop=restaurants[shop_id], coffee_shops=restaurants)
    return "Restaurant not found", 404

@app.route('/search')
def search():
    """Search for restaurants by title."""
    query = request.args.get('query', '').strip()
    
    # If the query is empty (all whitespace), redirect back to the current page
    if not query:
        return redirect(request.referrer or url_for('home'))
    
    # Search through restaurant titles
    results = {}
    for shop_id, shop in restaurants.items():
        if query.lower() in shop['title'].lower():
            results[shop_id] = shop
    
    return render_template('search_results.html', query=query, results=results)

@app.route('/api/shops')
def get_all_shops():
    """API endpoint to get all restaurants as JSON."""
    return jsonify(restaurants)

if __name__ == '__main__':
    app.run(debug=True, port=5001)